import Header from './components/header';
import Apresentacao from '../components/apresentacao';
import styled from 'styled-components';
import Divisao from '../components/divisao';
import Projetos from '../components/projetos';
import ProjetoUm from './ProjetoUm';
import { Inicio } from '../App';
import { AppGeral } from '../App';
import { TextoConstrucao } from '../App';
import { Titulo } from '../App';

function Home() {
    return (
    <AppGeral>
      <Header />
        <Inicio>
          <TextoConstrucao>Introdução a robótica com projetos simples</TextoConstrucao>
        </Inicio>
        <Apresentacao />
        <Divisao />
        <Titulo> Veja nossos projetos </Titulo>
        <Projetos />
    </AppGeral>
    );
  }

  export default Home;
